import React from 'react';

import './App.scss';

function App() {
  return (
    <div className="App">
      <div className="navBar">
        <div className="logo">
          logo
        </div>
        <ul>
          <li>Home</li>
          <li>Search</li>
          <li></li>
        </ul> 
      </div>   
    </div>
  );
}

export default App;
